import React from "react";
import { IonContent, IonPage, IonCardTitle, IonActionSheet, IonButton } from "@ionic/react";
import { Toolbar, Tabbar, SlideShow } from "../Components";

const Home = props => {
  const [showActionSheet, setShowActionSheet] = useState(false);
  return (
    <IonPage>
      <Toolbar />
      <IonContent className="ion-padding">
        <IonCardTitle>Home</IonCardTitle>
        <SlideShow url={""} />
        <IonButton src={() => {setShowActionSheet(true)}}>Show</IonButton>
      </IonContent>
      <IonActionSheet
        isOpen={showActionSheet}
        onDidDismiss={() => setShowActionSheet(false)}
        buttons={[{
          text: 'Delete',
          role: 'destructive',
          icon: 'trash',
          handler: () => {
            console.log('Delete clicked');
          }
        }, {
          text: 'Share',
          icon: 'share',
          handler: () => {
            console.log('Share clicked');
          }
        }, {
          text: 'Play (open modal)',
          icon: 'arrow-dropright-circle',
          handler: () => {
            console.log('Play clicked');
          }
        }, {
          text: 'Favorite',
          icon: 'heart',
          handler: () => {
            console.log('Favorite clicked');
          }
        }, {
          text: 'Cancel',
          icon: 'close',
          role: 'cancel',
          handler: () => {
            console.log('Cancel clicked');
          }
        }]}
      >
      </IonActionSheet>
      <Tabbar />
    </IonPage>
  );
};

export default Home;
